1. The newly recommended invisible ink always shows poor performance during production. In the meantime, the invisible ink is easily contaminated and turns gray. We have not been able to find the real reason, which has caused us huge losses.
2. CM two-color printing is prone to full-page background color;
3. The service life of BID consumables is unstable, and the service life of rubber blanket consumables is short due to the influence of invisible yellowing.
